            <Cart />
			<main style={{ padding: '1rem 0' }}>
				<h2>Products</h2>
                {availableItems.map( availableItem => {
                    return (
                        <Item itemInfo={availableItem}/>
                    )
                })}
			</main>
		</>
	);
}
